import React from 'react';

function MainBanner() {
  return (
    <section className="main-banner">
      <h2>Добро пожаловать в мир элитной мебели</h2>
      <p>Создайте уют и комфорт в вашем доме с нашей мебелью.</p>
    </section>
  );
}

export default MainBanner;
